function qwCreateFrame(qwarySettings, iframeWidth, iframeHeight) {

  $iframe = jQwary('<iframe>');

  $iframe
    .attr(
      'allow',
      'camera *; microphone *; autoplay *; encrypted-media *; fullscreen *; display-capture *;');

  if (qwarySettings.previewMode) {
    $iframe.addClass('lazyload designframe');
    $iframe.attr('id', 'designframe');
  }

  let popupPosition = qwarySettings.position;
  if (popupPosition == 'rightBottom') {
    if (qwarySettings.bottomPosition != null) {
      $iframe.css('bottom', '0px');
    }
  }

  let radius = qwarySettings.popupRadius;
  if (radius == null || typeof radius != 'undefined') {
    radius = '10px';
  }
  $iframe
    .css({
      'background': qwarySettings.loadingFrameBackgroundColor,
      'box-shadow': 'rgba(0, 0, 0, 0.08) 0px 2px 4px, rgba(0, 0, 0, 0.06) 0px 2px 12px',
      //'transition' : 'all 300ms ease-out 0s',
      'position': 'absolute',
      'max-height': '100%',
      'visibility': 'hidden',
      'opacity': '0'
      // 'min-height': '350px'

    });
  $iframe.css({
    'border-radius': radius,
    'width': iframeWidth,
    'height': iframeHeight,
    'bottom': '0px',
    'max-height': '100%'

  });

  let windowHeight = jQwary(window).height();

  let iframeURL = qwGetURLWithParameter(qwarySettings);
  $iframe.attr('src', iframeURL);
  return $iframe;
}
function qwGetURLWithParameter(qwarySettings) {
  let iframeURL = null;
  if (qwarySettings['converseAI']) {
    iframeURL = qwarySettings.converseURL + qwarySettings.surveyId;
  } else {
    iframeURL = qwarySettings.url + qwarySettings.surveyId;
  }
  let disableCookieWarning = qwarySettings.disableCookieWarning;
  let layout = qwarySettings.layout;
  let hideNavigation = qwarySettings.hideNavigation;
  let languageCode = qwarySettings.languageCode;
  let previewMode = qwarySettings.previewMode;
  let firstAttribute = true;
  let queryString = null;
  if (disableCookieWarning != null
    && typeof disableCookieWarning != 'undefined') {
    queryString = 'disableCookieWarning=' + disableCookieWarning;
  }
  if (layout != null && typeof layout != 'undefined') {
    if (queryString == null) {
      queryString = 'qw_layout=' + layout;
      if (parseInt(jQwary(window).width()) < 500) {
      }
    } else {
      queryString = queryString + '&qw_layout=' + layout;
    }
  }
  if (parseInt(jQwary(window).width()) < qwarySettings.mobileBreakpointWidth) {
    if (queryString == null) {
      queryString = 'qw_view=qw_compact_view';

    } else {
      queryString = queryString + '&qw_view=qw_compact_view';
    }
  }
  if (hideNavigation != null && typeof hideNavigation != 'undefined') {
    if (queryString == null) {
      queryString = 'hideNavigation=' + hideNavigation;
    } else {
      queryString = queryString + '&hideNavigation=' + hideNavigation;
    }

  }

  if (previewMode != null && typeof previewMode != 'undefined') {
    if (previewMode) {
      if (queryString == null) {
        queryString = 'previewMode=live';
      } else {
        queryString = queryString + '&previewMode=live';
      }
    }

  }

  if (languageCode != null && typeof languageCode != 'undefined') {
    if (queryString == null) {
      queryString = 'lang=' + languageCode;
    } else {
      queryString = queryString + '&lang=' + languageCode;
    }

  }

  let contact = qwarySettings.contact;
  if (contact == null || typeof contact == 'undefined') {
    if (window.qwSettings != null && typeof window.qwSettings != 'undefined' && window.qwSettings.contact != null && typeof window.qwSettings.contact != 'undefined') {
      contact = window.qwSettings.contact;
    } else {
      if (typeof qwaryClientIntercept != 'undefined') {
        contact = qwaryClientIntercept.getContactObj();
      }

    }
  }
  if (contact != null && typeof contact != 'undefined') {
    let email = contact.email;
    let contactUniqueId = contact.uniqueId;
    if ((email != null && email != 'undefined') || (contactUniqueId != null && contactUniqueId != 'undefined')) {

      if (contactUniqueId != null && contactUniqueId != 'undefined') {
        queryString = queryString + '&contact_id=' + contactUniqueId;
      } else {
        queryString = queryString + '&email=' + email;
      }

      let firstName = contact.firstName;
      if (firstName != null && firstName != 'undefined') {
        queryString = queryString + '&firstName=' + firstName;
      }

      let lastName = contact.lastName;
      if (lastName != null && lastName != 'undefined') {
        queryString = queryString + '&lastName=' + lastName;
      }

      let streetAddress = contact.streetAddress;
      if (streetAddress != null && streetAddress != 'undefined') {
        queryString = queryString + '&streetAddress=' + streetAddress;
      }

      let city = contact.city;
      if (city != null && city != 'undefined') {
        queryString = queryString + '&city=' + city;
      }

      let country = contact.country;
      if (country != null && country != 'undefined') {
        queryString = queryString + '&country=' + country;
      }

      let state = contact.state;
      if (state != null && state != 'undefined') {
        queryString = queryString + '&state=' + state;
      }

      let postalCode = contact.postalCode;
      if (postalCode != null && postalCode != 'undefined') {
        queryString = queryString + '&postalCode=' + postalCode;
      }
      let department = contact.department;
      if (department != null && department != 'undefined') {
        queryString = queryString + '&department=' + department;
      }

      let phoneNumber = contact.phoneNumber;
      if (phoneNumber != null && phoneNumber != 'undefined') {
        queryString = queryString + '&phoneNumber=' + phoneNumber;
      }
    }

  }
  if (queryString != null) {

    if (!iframeURL.endsWith('?')) {
      iframeURL = iframeURL + "?";
    }
    if (!queryString.startsWith('&')) {
      queryString = "&" + queryString;
    }

    iframeURL = iframeURL + queryString;
  }
  return iframeURL;
}
function qwIsUrlValid(url) {

  let expression = /(https?:\/\/(?:www\.|(?!www))[a-zA-Z0-9][a-zA-Z0-9-]+[a-zA-Z0-9]\.[^\s]{2,}|www\.[a-zA-Z0-9][a-zA-Z0-9-]+[a-zA-Z0-9]\.[^\s]{2,}|https?:\/\/(?:www\.|(?!www))[a-zA-Z0-9]+\.[^\s]{2,}|www\.[a-zA-Z0-9]+\.[^\s]{2,})/gi;
  let regex = new RegExp(expression);
  if (url.match(regex))
    return true;
  else
    return false;
}

