function getQwColorWithOpacity(color, opacity) {
  return color.replace(')', ', ' + opacity + ')').replace('rgb', 'rgba');
}

function removeQwLeadingSlash(url) {
  return (url[0] == "/") ? url = url.substr(1) : url;
}
function removeQwTrailingSlash(url) {
  return (url[url.length - 1] == "/") ? url.substr(0, url.length - 1) : url;
}
function createQwCookie(namePrefix, jsonObj) {
  /* try{
       jsonObj = removeQwNullsInObject(jsonObj)
   }catch(e){
       console.log(e);
   }*/

  let value = JSON.stringify(jsonObj);
  let appId = window.qwSettings.appId;
  let ciphertext = CryptoJS.AES.encrypt(value, appId).toString();
  let url = window.location.hostname;
  const domainName = getQwRootDomain(url);
  // console.log('domainName', domainName);
  Cookies.set(namePrefix + "-" + appId, ciphertext, {
    secure: true,
    expires: 365,
    path: '/',
    domain: domainName,
    sameSite: 'strict'
  });
}

function getQwCookieValue(namePrefix) {
  let appId = window.qwSettings.appId;
  let cookieValue = Cookies.get(namePrefix + "-" + appId);
  if (cookieValue != null && typeof cookieValue != 'undefined') {
    let bytes = CryptoJS.AES.decrypt(cookieValue, appId);
    return JSON.parse(bytes.toString(CryptoJS.enc.Utf8));
  }
  return null;
}

function removeQwCookie(namePrefix) {
  let appId = window.qwSettings.appId;
  let url = window.location.hostname;
  const domainName = getQwRootDomain(url);
  Cookies.remove(namePrefix + "-" + appId, { path: '', domain: domainName, secure: true })
}

function getQwRootDomain(domain) {
  /*if (typeof url === 'string')
      url = new URL(url);
  let domain = url.hostname;*/
  try {
    let elems = domain.split('.');
    let iMax = elems.length - 1;
    let elem1 = elems[iMax - 1];
    let elem2 = elems[iMax];
    let isSecondLevelDomain = iMax >= 3 && (elem1 + elem2).length <= 5;
    return "." + (isSecondLevelDomain ? elems[iMax - 2] + '.' : '') + elem1 + '.' + elem2;
  } catch (e) {
    console.log(e);
  }
  return domain;

}
