function qw_showMicroSurveyDialog(qwarySettings, qwaryUserSettings) {
  let iframeHeight = qwarySettings.popupHeight;
  let iframeWidth = qwarySettings.popupWidth;
  if (qwaryUserSettings.popupHeight != null && typeof qwaryUserSettings.popupHeight != 'undefined') {
    iframeHeight = qwaryUserSettings.popupHeight;

  }

  if (qwaryUserSettings.popupWidth != null && typeof qwaryUserSettings.popupWidth != 'undefined') {
    iframeWidth = qwaryUserSettings.popupWidth;

  }
  let containerWidth = '100%';
  let containerHeight = '100%';

  let $luncher = initializeLunch(qwarySettings, iframeWidth);
  setViewPosition($luncher, qwarySettings, qw_mobileView);
  $luncher = qw_positionLuncher(qwarySettings, $luncher);
  let $iframeContainer = jQwary('<div data-html2canvas-ignore class="qwary-full-panel" style="width: 0px;height: 0px; position:fixed;top: 0px;right: 0px;display:flex;justify-content:center;z-index:' + qwarySettings.zIndex + '; background: ' + qwarySettings.dialogFilterBackgroundColor + '">' +
    '<div class="qwary-popup-panel" style="position: relative;display:flex;justify-content:center;"></div></div>');
  let $popup_panel = $iframeContainer.find('.qwary-popup-panel');
  let showLunchButton = qwarySettings.showLunchButton;
  if (qwarySettings.layout != 'full_screen') {
    $popup_panel.css('margin-top', '15vh');
  }
  if (qw_mobileView) {
    iframeHeight = '100%';
    iframeWidth = '100%';
  } else {
    $popup_panel.css('border-radius', qwarySettings.popupRadius);
  }
  let appendTo = qwarySettings['appendTo'];
  let $appendToElement = null;
  if (typeof appendTo != 'undefined' && appendTo != null && appendTo != '') {
    $appendToElement = jQwary('.' + appendTo);
  }
  if (showLunchButton) {
    let $lunchButton = createLunchButton(qwarySettings, $luncher);
    $luncher.on('click', function (e) {
      qw_lunchMicroSurveyDialogSurvey(e, $iframeContainer, qwarySettings, iframeHeight, iframeWidth, jQwary('body'), containerWidth, containerHeight);
    });

    if (typeof $appendToElement != 'undefined' && $appendToElement != null) {
      $appendToElement.append($luncher);
    } else {
      jQwary('body').append($luncher);
    }
  } else {
    qw_lunchMicroSurveyDialogSurvey(null, $iframeContainer, qwarySettings, iframeHeight, iframeWidth, jQwary('body'), containerWidth, containerHeight);
  }

  if (typeof $appendToElement != 'undefined' && $appendToElement != null) {
    $appendToElement.append($iframeContainer);
  } else {
    jQwary('body').append($iframeContainer);
  }
}
