function qw_showMicroSurvey(qwarySettings, qwaryUserSettings) {

  let iframeHeight = window.defaultQwarySettings.microPopupHeight;
  let iframeMaxHeight = window.defaultQwarySettings.microPopupHeight;
  let iframeWidth = window.defaultQwarySettings.microPopupWidth;
  if (qwaryUserSettings.popupHeight != null
    && typeof qwaryUserSettings.popupHeight != 'undefined') {
    iframeHeight = qwaryUserSettings.popupHeight;

  }

  if (qwaryUserSettings.popupWidth != null
    && typeof qwaryUserSettings.popupWidth != 'undefined') {
    iframeWidth = qwaryUserSettings.popupWidth;

  }
  if (qw_mobileView) {
    iframeMaxHeight = jQwary(window).height() - 50;
  }

  let $luncher = initializeLunch(qwarySettings, iframeWidth);

  let popupPosition = qwarySettings.position;

  setViewPosition($luncher, qwarySettings, qw_mobileView);
  $luncher = qw_positionLuncher(qwarySettings, $luncher);
  let showLunchButton = qwarySettings.showLunchButton;
  if (showLunchButton) {

    let $lunchButton = createLunchButton(qwarySettings, $luncher);
    $luncher.on('click', function (e) {
      let isOpen = false;
      if (typeof $luncher.attr('data-open') != 'undefined') {
        isOpen = true;
      }
      if (!isOpen) {

        qw_lunchMicroSurvey(e, $luncher, qwarySettings, iframeHeight,
          iframeWidth);
      }

    });
  } else {

    if (qw_mobileView) {
      iframeHeight = jQwary(window).height();
      iframeWidth = jQwary(window).width();
    }
    $luncher.find('.qwary-side-panel').css({
      'display': 'flex',
      'justify-content': 'center',
      'align-items': 'center',
      'width': iframeWidth,
      'height': iframeHeight

    });

    qw_lunchMicroSurvey(null, $luncher, qwarySettings, iframeHeight,
      iframeWidth);

  }
  let appendTo = qwarySettings['appendTo'];
  let $appendToElement = null;
  if (typeof appendTo != 'undefined' && appendTo != null && appendTo != '') {
    $appendToElement = jQwary('.' + appendTo);
  }
  if (typeof $appendToElement != 'undefined' && $appendToElement != null) {
    $appendToElement.append($luncher);
  } else {
    jQwary('body').append($luncher);
  }

}
function qw_lunchMicroSurvey(e, $luncher, qwarySettings, iframeHeight, iframeWidth) {
  try {
    qwLogHistory(qwarySettings['surveyId'], 'SHOW');
  } catch (e) {
    console.log(e);
  }

  let $qwary_share = $luncher.find('.qwary-lunch-btn');
  let $qwary_side_panel = $luncher.find('.qwary-side-panel');
  let $closeButton = undefined;
  if (qwarySettings.removeWidget) {
    $closeButton = qwCreateCloseButton(qwarySettings, qw_mobileView);
    $closeButton.on('click', function (e) {

      qwClose(qwarySettings, $luncher, $iframe, $qwary_share,
        $qwary_side_panel, e);

    });
  }

  // let $qwary_side_panel = $luncher.find('.qwary-side-panel');
  let
    $iframe = $qwary_side_panel.find('iframe');
  if (typeof $iframe != 'undefined') {
    $iframe.remove();
  }

  let $iframeLoadingButton = $qw_iFrameLoading.clone();
  let $loadingContainer = $qwary_share;
  $iframeLoadingButton.css('stroke', qwarySettings.loadingSideTabProgress);
  if (qwarySettings.qwaryBranding) {
    $loadingContainer = $luncher.find('.qwary-branding');
    $iframeLoadingButton.css('stroke', '#475FFB');
    $iframeLoadingButton.css('right', 'auto');
  }

  $iframe = qwCreateFrame(qwarySettings, iframeWidth, iframeHeight);
  $luncher.find('.qwary-side-panel div').append($iframe);

  let showLunchButton = qwarySettings.showLunchButton;
  if (!showLunchButton) {
    $iframeLoadingButton.attr('width', '50px');
    $iframeLoadingButton.attr('height', '50px');
    $iframeLoadingButton.css({
      'stroke': qwarySettings.loadingProgressColor,
      'top': '50%'
    });
    showSurveyPanel();
    let $qwary__panel = $iframe.closest('.qwary-panel');
    $qwary__panel.css('visibility', 'hidden'); // need to have visibility
    // hidden otherwise it will
    // show up as box on load
    $qwary__panel.css('opacity', '0');
    $iframe.parent().append($iframeLoadingButton);
  } else {
    $loadingContainer.children().css('opacity', '0');
    $loadingContainer.append($iframeLoadingButton);
  }
  if (qwarySettings.loadingFrameBackgroundColor == 'transparent') {
    $qwary_side_panel.css({
      'visibility': 'hidden',
      'opacity': '0'
    });
  }

  $qwary_side_panel.attr('data-load', 'true');
  $iframe.on('load', function () {
    if (showLunchButton) {
      $qwary_share.css('display', 'none');
      showSurveyPanel();
    }

    $luncher.addClass('qwary-open qwary-custom');
    $luncher.css({
      'visibility': 'visible',
      'opacity': '1'
    });
    $iframe.css({
      'visibility': 'visible',
      'opacity': '1'
    });
    $iframe[0].contentWindow.postMessage('QWARY_LOAD_RESIZE_FRAME', '*');
    $iframeLoadingButton.remove();
    $loadingContainer.children().css('opacity', '1');

  });
  function showSurveyPanel() {
    let $qw_panel_wrap = $luncher.find('.qwary-panel-wrap');
    $iframe.css({
      'width': iframeWidth,
      'height': '100%',
      'border': 'none',
      'transition': 'none',
    });
    if (qw_mobileView) {
      $iframe.css({
        'max-width': '100%',
        'max-height': '100%'
      });
    } else {
      $iframe.css({
        'max-height': '90vh'
      });
    }
    $luncher.css({
      'width': iframeWidth,
      //'height' : iframeHeight
    });
    if (!qw_mobileView) {
      $luncher.css({
        'max-height': '90vh'
      });
    }

    if ($closeButton) {
      $qw_panel_wrap.append($closeButton);
    }
  }
}


