function qw_adjustDialogHeight(qwarySettings, qwaryUserSettings, dataJson, $frame) {
  // console.log('setting height ****');
  //let $frame = null;
  let $loading = null;
  let height = dataJson['height'];
  if (qwarySettings.showLunchButton) { //aading the code here so that button hides before width animation starts
    $frame.closest('.qwary-panel').find('.qwary-lunch-btn').css('display', 'none');
  }
  if (height > 0) {
    // if($loading.exists()){
    if (qwarySettings.position == 'dialog') {

      $loading = $frame.closest('.qwary-popup-panel[data-load]');
      $frame = $loading.find('iframe');
      $frame.height(height);
      $loading.css('height', height);
    } else {
      let $panel = $frame.closest('.qwary-panel');
      $loading = $panel.find('.qwary-side-panel[data-load]');
      $frame = $loading.find('iframe');
      if (qw_mobileView) {
        height = height + "px";
        $frame.height(height);
        $panel.css('height', height);
        $loading.css('height', height);
        $loading.find('.qwary-panel-wrap').css('height', height);
        // Satinder Change callback for height qwSurveyHeight
        try {
          qwSdkHook.qwSurveyHeight(`${height}`);
        } catch (e) {
          console.log('qwSurveyHeight', e);
        }
      } else {
        let family = dataJson['family'];
        let subFamily = dataJson['subFamily'];
        let inputType = dataJson['inputType'];

        let height = dataJson['height'];
        let width = window.defaultQwarySettings.microPopupWidth;
        if (qwaryUserSettings.popupWidth != null && typeof qwaryUserSettings.popupWidth != 'undefined') {
          width = qwaryUserSettings.popupWidth;

        }

        if (inputType == 'AUDIO' || inputType == 'VIDEO') {
          if (height < 520) {
            height = '520';
          }

          width = '520px';
        } else {
          if (family == 'rating') {
            if (subFamily == 'npr') {
              width = '520px';
            } else if (subFamily == 'calender') {
              width = '520px';
            }/*else if(subFamily == 'csat' || subFamily == 'ces'){
						width = '420px';
					}*/

          }
        }
        width = width;
        height = height + "px";
        $frame.width(width);
        $frame.height(height);
        $panel.css({
          'height': height,
          'width': width
        });
        $loading.css({
          'height': height,
          'width': width
        });
        $loading.css('height', height);
        $loading.find('.qwary-panel-wrap').css({
          'height': height,
          'width': width
        });
      }

    }

  }
  if ($frame != null) {
    let $qwary__panel = $frame.closest('.qwary-panel');
    $qwary__panel.find('.qwary-loading').remove();
    $qwary__panel.css('visibility', 'visible'); // need to have
    // visibility hidden
    // otherwise it will
    // show up as box on
    // load
    $qwary__panel.css('opacity', '1');
  }

  return $loading;
}
