function qwCreatePromptFrame(qwarySettings, iframeWidth, iframeHeight) {

  let $div = jQwary('<div class="qw-prompt-container">');


  if (qwarySettings.previewMode) {
    $div.attr('id', 'designframe');
  }

  let popupPosition = qwarySettings.position;
  if (popupPosition == 'rightBottom') {
    if (qwarySettings.bottomPosition != null) {
      $div.css('bottom', '0px');
    }
  }

  let radius = qwarySettings.popupRadius;
  if (radius == null || typeof radius != 'undefined') {
    radius = '10px';
  }
  $div.css({
    'background': qwarySettings.loadingFrameBackgroundColor,
    'box-shadow': 'rgba(0, 0, 0, 0.08) 0px 2px 4px, rgba(0, 0, 0, 0.06) 0px 2px 12px',
    'transition': 'all 300ms ease-out 0s',
    'max-height': '100%',
    'opacity': '1',
    'visibility': 'visible',
    'padding': '25px'
  });
  $div.css({
    'border-radius': radius,
    'width': iframeWidth,
    'height': iframeHeight,
    'bottom': '0px',
    'max-height': '100%'

  });
  let buttonBackgroundColor = qwarySettings.buttonBackgroundColor;
  let buttonColor = qwarySettings.buttonColor;
  let promptTitle = qwarySettings.promptTitle;
  let promptBody = qwarySettings.promptBody;
  let promptButtonText = qwarySettings.promptButtonText;
  let url = qwGetURLWithParameter(qwarySettings);
  url = url.replace('&qw_layout=micro_prompt_survey', '');

  $div.append('<h1 style="font-weight: 700;font-size: 18px;line-height: 24px;margin-bottom: 8px;">' + promptTitle + '</h1>');
  $div.append('<p style="font-weight: 400;font-size: 16px;line-height: 24px;margin: 0px;padding: 0px">' + promptBody + '</p>');
  let $btn = jQwary('<a href=' + url + '"" target="_new" style="background: ' + buttonBackgroundColor + '; color: ' + buttonColor + ';width:100%;border-radius: 6px; display: flex; flex-direction: row; -webkit-box-pack: center; justify-content: center; -webkit-box-align: center; align-items: center; flex-shrink: 0; padding: 10px 16px; font-weight: 600; font-size: 16px; line-height: 24px; width: 100%; border: none; cursor: pointer; margin-top: 16px; transition: all 0.2s ease-in-out 0s;">' + promptButtonText + '</a>');
  $div.append($btn);
  let windowHeight = jQwary(window).height();
  $btn.on('click', function (e) {
    let layoutType = qwarySettings['layoutType'];
    try {
      qwLogHistory(qwarySettings['surveyId'], 'PROMPT_CLICKED');
    } catch (e) {
      console.log(e);
    }
    if (typeof layoutType != 'undefined' && layoutType != null) {
      if (layoutType == 'full_screen') {
        qwarySettings.popupHeight = '100vh';
        qwarySettings.popupWidth = '100vw';
        if (!qwarySettings.mobileBreakpointHeight) { //if not set in custom arguments then only set
          qwarySettings.mobileBreakpointHeight = '100vh';
        }
        qwarySettings['layout'] = 'full_screen';
        qwarySettings['removeWidget'] = true;
        qw_showMicroSurveyDialog(qwarySettings, qwarySettings);
        e.preventDefault();
      } else if (layoutType == 'dialog') {
        if (!qwarySettings.mobileBreakpointHeight) { //if not set in custom arguments then only set
          qwarySettings.mobileBreakpointHeight = '100vh';
        }
        if (!qw_mobileView) { //if not set in custom arguments then only set
          qwarySettings.popupHeight = '70vh';
          qwarySettings.popupWidth = '70vw';
        } else {
          qwarySettings.popupHeight = '100vh';
          qwarySettings.popupWidth = '100vw';
        }
        qwarySettings['layout'] = 'micro_survey';
        qwarySettings['removeWidget'] = true;
        qw_showMicroSurveyDialog(qwarySettings, qwarySettings);
        e.preventDefault();
      }
    }
    $div.closest('.qwary-panel').remove();
    //if(!qwarySettings.popupHeight){ //if not set in custom arguments then only set

    //}

    //if(!qwarySettings.popupWidth){ //if not set in custom arguments then only set

    //}



  });

  //$iframe.attr('src', iframeURL);
  return $div;
}


