function showVideoThumbnail(qwarySettings) {
  let rulesURL = qwarySettings.rulesUrl + qwarySettings.surveyId;
  jQwary.ajax({
    url: rulesURL,
    type: "GET",
    crossDomain: true,
    success: function (data) {
      if (qwarySettings.layout == 'video_large') {
        createVideoThumbnailLargeButton(qwarySettings, data);
      } else if (qwarySettings.layout == 'video_small') {
        createVideosSmallThumbnalButton(qwarySettings, data);
      }
    },
    error: function (data, status, er) {
      console.log("error: " + data + " status: " + status + " er:" + er);
    }
  });
}
