function qw_lunchVideoSurvey(e, $luncher, qwarySettings, iframeHeight, iframeWidth, luncherHeight, luncherWidth) {
  try {
    qwLogHistory(qwarySettings['surveyId'], 'SHOW');
  } catch (e) {
    console.log(e);
  }
  let $qwary_share = $luncher.find('.qwary-lunch-btn');
  $qwary_share.hide();
  let $side_panel = $luncher.find('.qwary-side-panel');

  var $closeButton = undefined;
  if (qwarySettings.removeWidget) {
    $closeButton = qwCreateCloseButton(qwarySettings, qw_mobileView);
  }
  if (parseInt(jQwary(window).width()) < 500) {
    iframeHeight = jQwary(window).height();
    iframeWidth = jQwary(window).width();
    $luncher.css({
      'top': '0px',
      'right': '0px',
    });

    // $luncher.css('top','0px');
    if (typeof $closeButton != 'undefined') {
      $closeButton.css({
        'top': '10px',
        'right': '7px',
      });
    }

  } else {

    if (typeof $closeButton != 'undefined') {
      $closeButton.css({
        'top': '-39px',
        'right': '7px',
      });
    }
  }
  if (typeof $closeButton != 'undefined') {
    $closeButton.on('click', function (e) {
      try {
        qwLogHistory(qwarySettings['surveyId'], 'CLOSE');
      } catch (e) {
        console.log(e);
      }
      let showLunchButton = qwarySettings.showLunchButton;
      let removeWidgetOnClose = qwarySettings.removeWidgetOnClose;
      if (removeWidgetOnClose) {
        $luncher.remove();
      } else {
        $iframe.remove();
        if (showLunchButton) {

          /*$luncher.closest('.qwary-panel').css({
            'height' : 'auto',
            'width' : 'auto',
          });*/
          $luncher.css({
            'width': luncherWidth,
            'height': luncherHeight
          });
          $luncher.find('.qwary-close').remove();
          $luncher.find('.qwary-loading').remove();
          $luncher.find('.qwary-lunch-btn').fadeIn(500);
          /*if (parseInt(jQwary(window).width()) < 500) {
            $luncher.css({
              'top' : 'auto',
              'right' : '15px',
              'bottom' : '15px'
            });
          }*/
        }
      }
      if ($side_panel.length != 0) {
        $side_panel.css({
          'height': '0px',
          'width': '0px'
        });
      }
      qwClearHighlights();
      qwPreviewOperationsOnClose(qwarySettings);
      e.stopPropagation();
    });
  }

  let $iframe = $side_panel.find('iframe');
  if (typeof $iframe != 'undefined' && $iframe.length != 0) {
    $iframe.remove();

  }
  $side_panel.css({
    'width': iframeWidth,
    'height': iframeHeight
  });
  let $iframeLoadingButton = $qw_iFrameLoadingContainer.clone();
  $iframeLoadingButton.css({
    'height': '50px',
    'width': '50px',
    'right': '45%',
    'top': '45%'
  });

  let $loadingContainer = $qwary_share;

  $iframe = jQwary('<iframe>');
  $side_panel.css('background', qwarySettings.loadingFrameBackgroundColor);
  $iframe.css('background', qwarySettings.loadingFrameBackgroundColor);
  if (parseInt(jQwary(window).width()) >= 500) {
    $iframe.css('border-radius', '12px');
    $side_panel.css('border-radius', '12px');
  }

  $iframe
    .attr(
      'allow',
      'camera *; microphone *; autoplay *; encrypted-media *; fullscreen *; display-capture *;');

  $iframe.css('box-shadow', '0px 0px 10px rgb(18 17 37 / 20%)');

  $iframe.css('width', '100%');
  $iframe.css('height', '100%');
  $iframe.css('border', 0);
  if (parseInt(jQwary(window).width()) > qwarySettings.mobileBreakpointWidth) {
    $iframe.css('border-radius', qwarySettings.popupRadius);
    $side_panel.css('border-radius', qwarySettings.popupRadius);
  }
  // $luncher.append($iframe);
  // $iframeLoadingButton.attr('width','50px');
  // $iframeLoadingButton.attr('height','50px');
  /*
   * $iframeLoadingButton.css({ 'stroke' : qwarySettings.loadingProgressColor
   * });
   */

  let windowHeight = jQwary(window).height();

  let iframeURL = qwGetURLWithParameter(qwarySettings);
  if (qwarySettings.playVideoOnLoad != null
    && (qwarySettings.playVideoOnLoad || qwarySettings.playVideoOnLoad == 'true')) {
    iframeURL = iframeURL + '&showOnLoad=true';
  }

  $iframe.attr('src', iframeURL);
  showSurveyPanel();
  $iframe.css({
    'visibility': 'hidden',
    'opacity': '0',
    'transition': 'all 0.3s'
  });
  $side_panel.append($iframe);

  let showLunchButton = qwarySettings.showLunchButton;
  if (!showLunchButton) {
    $side_panel.css({
      'width': iframeWidth,
      'height': iframeHeight,
      'border': 'none'
    });
    /*
     * $iframeLoadingButton.css({ 'stroke' :
     * qwarySettings.loadingProgressColor });
     */
    $iframe.parent().append($iframeLoadingButton);
    /*
     * $luncher.css({ 'top':'0', 'right':'0', 'bottom':'auto'
     *
     * });
     */
  } else {
    // $loadingContainer.children().css('opacity', '0');
    $side_panel.append($iframeLoadingButton);
  }

  $iframe.on('load', function () {
    $iframeLoadingButton.remove();
    $iframe.css({
      'visibility': 'visible',
      'opacity': '1',
      'transition': 'none'
    });
    // $loadingContainer.children().css('opacity', '1');
  });
  function showSurveyPanel() {
    if (qw_mobileView) {
      $luncher.css('top', '0px');
    }
    $iframe.css({
      'width': iframeWidth,
      'height': iframeHeight,
      'border': 'none'
    });
    $luncher.css({
      'width': iframeWidth,
      'height': iframeHeight
    });
    $luncher.append($closeButton);
    $iframe.css('visibility', 'visible');
  }
}
