//https://github.com/jasonzissman/TimeMe.js/
(() => {
  ((root, factory) => {
    if (typeof module !== 'undefined' && module.exports) {
      // CommonJS
      return module.exports = factory();
    } else if (typeof define === 'function' && define.amd) {
      // AMD
      define([], () => {
        return (root.qwTimeTracker = factory());
      });
    } else {
      // Global Variables
      return root.qwTimeTracker = factory();
    }
  })(this, () => {

    let qwTimeTracker = {

      startStopTimes: {},
      idleTimeoutMs: 30 * 1000,
      currentIdleTimeMs: 0,
      checkIdleStateRateMs: 250,
      isUserCurrentlyOnPage: true,
      isUserCurrentlyIdle: false,
      currentPageName: "default-page-name",
      timeElapsedCallbacks: [],
      userLeftCallbacks: [],
      userReturnCallbacks: [],

      trackTimeOnElement: (elementId) => {
        let element = document.getElementById(elementId);
        if (element) {
          element.addEventListener("mouseover", () => {
            qwTimeTracker.startTimer(elementId);
          });
          element.addEventListener("mousemove", () => {
            qwTimeTracker.startTimer(elementId);
          });
          element.addEventListener("mouseleave", () => {
            qwTimeTracker.stopTimer(elementId);
          });
          element.addEventListener("keypress", () => {
            qwTimeTracker.startTimer(elementId);
          });
          element.addEventListener("focus", () => {
            qwTimeTracker.startTimer(elementId);
          });
        }
      },

      getTimeOnElementInSeconds: (elementId) => {
        let time = qwTimeTracker.getTimeOnPageInSeconds(elementId);
        if (time) {
          return time;
        } else {
          return 0;
        }
      },

      // startTime is optional. If provided, must be of type Date(). By providing
      // startTime, you are overriding the internal timing mechanism and manually
      // indicating the start time.
      startTimer: (pageName, startTime) => {
        if (!pageName) {
          pageName = qwTimeTracker.currentPageName;
        }

        if (qwTimeTracker.startStopTimes[pageName] === undefined) {
          qwTimeTracker.startStopTimes[pageName] = [];
        } else {
          let arrayOfTimes = qwTimeTracker.startStopTimes[pageName];
          let latestStartStopEntry = arrayOfTimes[arrayOfTimes.length - 1];
          if (latestStartStopEntry !== undefined && latestStartStopEntry.stopTime === undefined) {
            // Can't start new timer until previous finishes.
            return;
          }
        }
        qwTimeTracker.startStopTimes[pageName].push({
          "startTime": startTime || new Date(),
          "stopTime": undefined
        });
      },

      stopAllTimers: () => {
        let pageNames = Object.keys(qwTimeTracker.startStopTimes);
        for (let i = 0; i < pageNames.length; i++) {
          qwTimeTracker.stopTimer(pageNames[i]);
        }
      },

      // stopTime is optional. If provided, must be of type Date(). By providing
      // stopTime, you are overriding the internal timing mechanism and manually
      // indicating the stop time.
      stopTimer: (pageName, stopTime) => {
        if (!pageName) {
          pageName = qwTimeTracker.currentPageName;
        }
        let arrayOfTimes = qwTimeTracker.startStopTimes[pageName];
        if (arrayOfTimes === undefined || arrayOfTimes.length === 0) {
          // Can't stop timer before you've started it.
          return;
        }
        if (arrayOfTimes[arrayOfTimes.length - 1].stopTime === undefined) {
          arrayOfTimes[arrayOfTimes.length - 1].stopTime = stopTime || new Date();
        }
      },

      getTimeOnCurrentPageInSeconds: () => {
        return qwTimeTracker.getTimeOnPageInSeconds(qwTimeTracker.currentPageName);
      },

      getTimeOnPageInSeconds: (pageName) => {
        let timeInMs = qwTimeTracker.getTimeOnPageInMilliseconds(pageName);
        if (timeInMs === undefined) {
          return undefined;
        } else {
          return timeInMs / 1000;
        }
      },

      getTimeOnCurrentPageInMilliseconds: () => {
        return qwTimeTracker.getTimeOnPageInMilliseconds(qwTimeTracker.currentPageName);
      },

      getTimeOnPageInMilliseconds: (pageName) => {

        let totalTimeOnPage = 0;

        let arrayOfTimes = qwTimeTracker.startStopTimes[pageName];
        if (arrayOfTimes === undefined) {
          // Can't get time on page before you've started the timer.
          return;
        }

        let timeSpentOnPageInSeconds = 0;
        for (let i = 0; i < arrayOfTimes.length; i++) {
          let startTime = arrayOfTimes[i].startTime;
          let stopTime = arrayOfTimes[i].stopTime;
          if (stopTime === undefined) {
            stopTime = new Date();
          }
          let difference = stopTime - startTime;
          timeSpentOnPageInSeconds += (difference);
        }

        totalTimeOnPage = Number(timeSpentOnPageInSeconds);
        return totalTimeOnPage;
      },

      getTimeOnAllPagesInSeconds: () => {
        let allTimes = [];
        let pageNames = Object.keys(qwTimeTracker.startStopTimes);
        for (let i = 0; i < pageNames.length; i++) {
          let pageName = pageNames[i];
          let timeOnPage = qwTimeTracker.getTimeOnPageInSeconds(pageName);
          allTimes.push({
            "pageName": pageName,
            "timeOnPage": timeOnPage
          });
        }
        return allTimes;
      },

      setIdleDurationInSeconds: (duration) => {
        let durationFloat = parseFloat(duration);
        if (isNaN(durationFloat) === false) {
          qwTimeTracker.idleTimeoutMs = duration * 1000;
        } else {
          throw {
            name: "InvalidDurationException",
            message: "An invalid duration time (" + duration + ") was provided."
          };
        }
      },

      setCurrentPageName: (pageName) => {
        qwTimeTracker.currentPageName = pageName;
      },

      resetRecordedPageTime: (pageName) => {
        delete qwTimeTracker.startStopTimes[pageName];
      },

      resetAllRecordedPageTimes: () => {
        let pageNames = Object.keys(qwTimeTracker.startStopTimes);
        for (let i = 0; i < pageNames.length; i++) {
          qwTimeTracker.resetRecordedPageTime(pageNames[i]);
        }
      },
      userActivityDetected: () => {
        if (qwTimeTracker.isUserCurrentlyIdle) {
          qwTimeTracker.triggerUserHasReturned();
        }
        qwTimeTracker.resetIdleCountdown();
      },
      resetIdleCountdown: () => {
        qwTimeTracker.isUserCurrentlyIdle = false;
        qwTimeTracker.currentIdleTimeMs = 0;
      },

      callWhenUserLeaves: (callback, numberOfTimesToInvoke) => {
        qwTimeTracker.userLeftCallbacks.push({
          callback: callback,
          numberOfTimesToInvoke: numberOfTimesToInvoke
        })
      },

      callWhenUserReturns: (callback, numberOfTimesToInvoke) => {
        qwTimeTracker.userReturnCallbacks.push({
          callback: callback,
          numberOfTimesToInvoke: numberOfTimesToInvoke
        })
      },

      triggerUserHasReturned: () => {
        if (!qwTimeTracker.isUserCurrentlyOnPage) {
          qwTimeTracker.isUserCurrentlyOnPage = true;
          qwTimeTracker.resetIdleCountdown();
          for (let i = 0; i < qwTimeTracker.userReturnCallbacks.length; i++) {
            let userReturnedCallback = qwTimeTracker.userReturnCallbacks[i];
            let numberTimes = userReturnedCallback.numberOfTimesToInvoke;
            if (isNaN(numberTimes) || (numberTimes === undefined) || numberTimes > 0) {
              userReturnedCallback.numberOfTimesToInvoke -= 1;
              userReturnedCallback.callback();
            }
          }
        }
        qwTimeTracker.startTimer();
      },
      // TODO - we are muddying the waters in between
      // 'user left page' and 'user gone idle'. Really should be
      // two separate concepts entirely. Need to break this into smaller  functions
      // for either scenario.
      triggerUserHasLeftPageOrGoneIdle: () => {
        if (qwTimeTracker.isUserCurrentlyOnPage) {
          qwTimeTracker.isUserCurrentlyOnPage = false;
          for (let i = 0; i < qwTimeTracker.userLeftCallbacks.length; i++) {
            let userHasLeftCallback = qwTimeTracker.userLeftCallbacks[i];
            let numberTimes = userHasLeftCallback.numberOfTimesToInvoke;
            if (isNaN(numberTimes) || (numberTimes === undefined) || numberTimes > 0) {
              userHasLeftCallback.numberOfTimesToInvoke -= 1;
              userHasLeftCallback.callback();
            }
          }
        }
        qwTimeTracker.stopAllTimers();
      },

      callAfterTimeElapsedInSeconds: (timeInSeconds, callback) => {
        qwTimeTracker.timeElapsedCallbacks.push({
          timeInSeconds: timeInSeconds,
          callback: callback,
          pending: true
        });
      },

      checkIdleState: () => {
        for (let i = 0; i < qwTimeTracker.timeElapsedCallbacks.length; i++) {
          if (qwTimeTracker.timeElapsedCallbacks[i].pending && qwTimeTracker.getTimeOnCurrentPageInSeconds() > qwTimeTracker.timeElapsedCallbacks[i].timeInSeconds) {
            qwTimeTracker.timeElapsedCallbacks[i].callback();
            qwTimeTracker.timeElapsedCallbacks[i].pending = false;
          }
        }
        if (qwTimeTracker.isUserCurrentlyIdle === false && qwTimeTracker.currentIdleTimeMs > qwTimeTracker.idleTimeoutMs) {
          qwTimeTracker.isUserCurrentlyIdle = true;
          qwTimeTracker.triggerUserHasLeftPageOrGoneIdle();
        } else {
          qwTimeTracker.currentIdleTimeMs += qwTimeTracker.checkIdleStateRateMs;
        }
      },

      visibilityChangeEventName: undefined,
      hiddenPropName: undefined,

      listenForVisibilityEvents: (trackWhenUserLeavesPage, trackWhenUserGoesIdle) => {

        if (trackWhenUserLeavesPage) {
          qwTimeTracker.listenForUserLeavesOrReturnsEvents();
        }

        if (trackWhenUserGoesIdle) {
          qwTimeTracker.listForIdleEvents();
        }

      },

      listenForUserLeavesOrReturnsEvents: () => {
        if (typeof document.hidden !== "undefined") {
          qwTimeTracker.hiddenPropName = "hidden";
          qwTimeTracker.visibilityChangeEventName = "visibilitychange";
        } else if (typeof document.mozHidden !== "undefined") {
          qwTimeTracker.hiddenPropName = "mozHidden";
          qwTimeTracker.visibilityChangeEventName = "mozvisibilitychange";
        } else if (typeof document.msHidden !== "undefined") {
          qwTimeTracker.hiddenPropName = "msHidden";
          qwTimeTracker.visibilityChangeEventName = "msvisibilitychange";
        } else if (typeof document.webkitHidden !== "undefined") {
          qwTimeTracker.hiddenPropName = "webkitHidden";
          qwTimeTracker.visibilityChangeEventName = "webkitvisibilitychange";
        }

        document.addEventListener(qwTimeTracker.visibilityChangeEventName, () => {
          if (document[qwTimeTracker.hiddenPropName]) {
            qwTimeTracker.triggerUserHasLeftPageOrGoneIdle();
          } else {
            qwTimeTracker.triggerUserHasReturned();
          }
        }, false);

        window.addEventListener('blur', () => {
          qwTimeTracker.triggerUserHasLeftPageOrGoneIdle();
        });

        window.addEventListener('focus', () => {
          qwTimeTracker.triggerUserHasReturned();
        });
      },

      listForIdleEvents: () => {
        document.addEventListener("mousemove", () => { qwTimeTracker.userActivityDetected(); });
        document.addEventListener("keyup", () => { qwTimeTracker.userActivityDetected(); });
        document.addEventListener("touchstart", () => { qwTimeTracker.userActivityDetected(); });
        window.addEventListener("scroll", () => { qwTimeTracker.userActivityDetected(); });

        setInterval(() => {
          if (qwTimeTracker.isUserCurrentlyIdle !== true) {
            qwTimeTracker.checkIdleState();
          }
        }, qwTimeTracker.checkIdleStateRateMs);
      },

      websocket: undefined,

      websocketHost: undefined,

      setUpWebsocket: (websocketOptions) => {
        if (window.WebSocket && websocketOptions) {
          let websocketHost = websocketOptions.websocketHost; // "ws://hostname:port"
          try {
            qwTimeTracker.websocket = new WebSocket(websocketHost);
            window.onbeforeunload = () => {
              qwTimeTracker.sendCurrentTime(websocketOptions.appId);
            };
            qwTimeTracker.websocket.onopen = () => {
              qwTimeTracker.sendInitWsRequest(websocketOptions.appId);
            }
            qwTimeTracker.websocket.onerror = (error) => {
              if (console) {
                console.log("Error occurred in websocket connection: " + error);
              }
            }
            qwTimeTracker.websocket.onmessage = (event) => {
              if (console) {
                console.log(event.data);
              }
            }
          } catch (error) {
            if (console) {
              console.error("Failed to connect to websocket host.  Error:" + error);
            }
          }
        }
      },

      websocketSend: (data) => {
        qwTimeTracker.websocket.send(JSON.stringify(data));
      },

      sendCurrentTime: (appId) => {
        let timeSpentOnPage = qwTimeTracker.getTimeOnCurrentPageInMilliseconds();
        let data = {
          type: "INSERT_TIME",
          appId: appId,
          timeOnPageMs: timeSpentOnPage,
          pageName: qwTimeTracker.currentPageName
        };
        qwTimeTracker.websocketSend(data);
      },
      sendInitWsRequest: (appId) => {
        let data = {
          type: "INIT",
          appId: appId
        };
        qwTimeTracker.websocketSend(data);
      },

      initialize: (options) => {

        let idleTimeoutInSeconds = qwTimeTracker.idleTimeoutMs || 30;
        let currentPageName = qwTimeTracker.currentPageName || "default-page-name";
        let websocketOptions = undefined;
        let initialStartTime = undefined;
        let trackWhenUserLeavesPage = true;
        let trackWhenUserGoesIdle = true;

        if (options) {
          idleTimeoutInSeconds = options.idleTimeoutInSeconds || idleTimeoutInSeconds;
          currentPageName = options.currentPageName || currentPageName;
          websocketOptions = options.websocketOptions;
          initialStartTime = options.initialStartTime;

          if (options.trackWhenUserLeavesPage === false) {
            trackWhenUserLeavesPage = false;
          }
          if (options.trackWhenUserGoesIdle === false) {
            trackWhenUserGoesIdle = false;
          }
        }

        qwTimeTracker.setIdleDurationInSeconds(idleTimeoutInSeconds)
        qwTimeTracker.setCurrentPageName(currentPageName)
        qwTimeTracker.setUpWebsocket(websocketOptions)
        qwTimeTracker.listenForVisibilityEvents(trackWhenUserLeavesPage, trackWhenUserGoesIdle);

        // TODO - only do this if page currently visible.

        qwTimeTracker.startTimer(undefined, initialStartTime);
      }
    };
    return qwTimeTracker;
  });
}).call(this);
