function qwRuleCheckOnLoad() { //this checks if page is loaded as well
  if (!qwRuleCheckOnLoaded) {
    if (qwaryClientIntercept) {
      qwaryClientIntercept.evaluateAccountAutoEventRules();
      const decision = qwaryClientIntercept.evaluateProjectRules();
      if (decision && decision['settings']) {
        let wait = decision['wait'] * 1000;
        let timeout = setTimeout(function () {
          qwary.survey(function () {
            //callback function to get called when survey participant is completed
          }, function () {
            //callback function to get called when survey participant is disqualified
          }, decision['settings']);
        }, wait);
        if (wait != 0) {
          qwTimeouts.push(timeout);
        }

      }
      qwRuleCheckOnLoaded = true;
    }

  }


}
