  function getFieldTitleCase(str) {
    str = str.toLowerCase().split('_');
    for (let i = 1; i < str.length; i++) { //dont' make first word capitalize
      str[i] = str[i].charAt(0).toUpperCase() + str[i].slice(1);
    }
    return str.join('');

  }
  function isEqualStrings(val1, val2) {
    if (typeof val1 != 'undefined' && val1 != null && typeof val2 != 'undefined' && val2 != null) {
      if (val1.toUpperCase() === val2.toUpperCase()) {
        return true;
      }
    }
    return false;
  }
  function validateEventConditions(event) {
    const conditionType = event['conditionType'];
    const condition = event['condition'];
    const value = event['value'];
    const eventName = event['name'];
    if ("is_not_set" === conditionType) {
      return isNotSetInHistory(eventName);
    } else if ("is_set" === conditionType) {
      return isSetInHistory(eventName);
    } else if ("occurrences" === conditionType) {
      /*if("eq" === condition){

      }else if("greater_then" === condition){

      }else if("less_then" === condition){

      }*/
      return isOccuranceMet(eventName, condition, value);
    } else if ("first_occurred" == conditionType) {
      /*if("eq" === condition){

      }else if("greater_then" === condition){

      }else if("less_then" === condition){

      }*/
      return isFirstOccuranceMet(eventName, condition, value);
    } else if ("last_occurred" == conditionType) {
      /*if("eq" === condition){

      }else if("greater_then" === condition){

      }else if("less_then" === condition){

      }*/
      return isLastOccuranceMet(eventName, condition, value);
    }
  }
  function isNotSetInHistory(eventName) {
    if (contactHistory != null) {

      for (let p = 0; p < contactHistory.length; p++) {
        let history = contactHistory[p];
        if (history['isNew'] === false || typeof history['isNew'] === 'undefined' || history['isNew'] === null) {
          history['isNew'] = false;
          if (history['eventName'] == eventName) {
            return false;
          }
        }

      }

    }
    return true;
  }
  function isSetInHistory(eventName) {
    if (contactHistory != null) {
      for (let p = 0; p < contactHistory.length; p++) {
        let history = contactHistory[p];
        if (history['eventName'] == eventName) {
          return true;
        }
      }

    }
    return false;
  }
  function isOccuranceMet(eventName, condition, value) {
    let count = 0;
    if (contactHistory != null) {
      contactHistory.forEach((history) => {
        ////console.log(history);
        if (history['eventName'] == eventName) {
          count = count + 1;
        }
      });
    }
    if ("eq" === condition) {
      if (count == value) {
        return true;
      }
    } else if ("greater_then" === condition) {
      if (count > value) {
        return true;
      }
    } else if ("less_then" === condition) {
      if (count < value) {
        return true;
      }
    }
    return false;
  }

  function isFirstOccuranceMet(eventName, condition, value) {
    let firstOccuranceDate = null;


    if (contactHistory != null) {
      contactHistory.forEach((history) => {
        ////console.log(history);
        if (history['eventName'] == eventName) {
          if (firstOccuranceDate == null || (firstOccuranceDate > history['createdDate'])) {
            firstOccuranceDate = history['createdDate'];
          }
        }
      });
    }
    if (firstOccuranceDate != null) {
      firstOccuranceDate = new Date(firstOccuranceDate);//because it will have time in long
      let currentDate = new Date();
      // To calculate the time difference of two dates
      let differenceInTime = currentDate.getTime() - firstOccuranceDate.getTime();
      // To calculate the no. of days between two dates
      let differenceInDays = differenceInTime / (1000 * 3600 * 24);
      differenceInDays = Math.floor(differenceInDays);
      //To display the final no. of days (result)
      /*//console.log("Total number of days between dates  <br>"
                 + firstOccuranceDate + "<br> and <br>"
                 + currentDate + " is: <br> "
                 + differenceInDays);*/
      differenceInDays = Math.floor(differenceInDays);
      if ("eq" === condition) {
        if (differenceInDays == value) {
          return true;
        }
      } else if ("greater_then" === condition) {
        if (differenceInDays > value) {
          return true;
        }
      } else if ("less_then" === condition) {
        if (differenceInDays < value) {
          return true;
        }
      }

    }


    return false;
  }
  function isLastOccuranceMet(eventName, condition, value) {
    let lastOccuranceDate = null;


    if (contactHistory != null) {
      contactHistory.forEach((history) => {
        ////console.log(history);
        if (history['eventName'] == eventName) {
          if (firstOccuranceDate == null || (lastOccuranceDate < history['createdDate'])) {
            lastOccuranceDate = history['createdDate'];
          }
        }
      });
    }
    if (lastOccuranceDate != null) {
      lastOccuranceDate = new Date(lastOccuranceDate);//because it will have time in long
      let currentDate = new Date();
      // To calculate the time difference of two dates
      let differenceInTime = currentDate.getTime() - firstOccuranceDate.getTime();
      // To calculate the no. of days between two dates
      let differenceInDays = differenceInTime / (1000 * 3600 * 24);
      differenceInDays = Math.floor(differenceInDays);
      //To display the final no. of days (result)
      /*//console.log("Total number of days between dates  <br>"
                 + firstOccuranceDate + "<br> and <br>"
                 + currentDate + " is: <br> "
                 + differenceInDays);*/
      differenceInDays = Math.floor(differenceInDays);
      if ("eq" === condition) {
        if (differenceInDays == value) {
          return true;
        }
      } else if ("greater_then" === condition) {
        if (differenceInDays > value) {
          return true;
        }
      } else if ("less_then" === condition) {
        if (differenceInDays < value) {
          return true;
        }
      }

    }


    return false;
  }
