    evaluateSurveyRules: function (clonedRules) {
      let validRule = null;
      ////console.log("EVALUATION SURVEYS");
      let rulesToEvaluate = [];
      for (let p = 0; p < clonedRules.length; p++) {
        const ruleObj = clonedRules[p]['ruleObj'];
        if (ruleObj != null && typeof ruleObj != 'undefined') {
          const decision = ruleObj['decision'];
          if (decision != null && decision['settings'] != null && decision['settings']['layout'] != 'banner' && decision['recordingSettings'] == null) {
            rulesToEvaluate.push(clonedRules[p]);
          }
        }

      }
      for (let i = 0; i < rulesToEvaluate.length; i++) {
        let rule = rulesToEvaluate[i];
        if ((rule['staticRule'] == null || typeof rule['staticRule'] == 'undefined' || !rule['staticRule'])) {
          ////console.log("********************************");
          ////console.log('evaluating dynamic rule :: ', rule);
          validRule = checkForValidRule(rule);
          if (validRule != null) {
            let continueToLookForNextRule = clientInterceptLogic.loadSurvey(rule); //break on first match of the rule
            ////console.log("********************************");
            if (!continueToLookForNextRule) {
              break;
            } else {
              validRule = null;//so that previous rule does not get evaluated again
            }
          }
          ////console.log("********************************");
        }
      }
    },
