/* Start: video thumbnail screen */
function qwInit(sdkSettings) {

  if (qwaryClientIntercept == null) {
    qwaryClientIntercept = jQwary(this).initializeQwaryClientIntercept();
  }


  let request = new Object();
  let identifier = sdkSettings.identifier;


  let contact = sdkSettings['contact'];
  let isVisitor = false;
  let contactFromCache = qwaryClientIntercept.getContactObj();
  if (contact == null || typeof contact == 'undefined' || identifier == 'visitor') {
    contact = contactFromCache;
    isVisitor = true;
    request['identifierType'] = identifier;
    if (contact != null && typeof contact != 'undefined') {
      request['identifier'] = contact['uniqueId'];
    }
  } else {
    if (contact != null) {
      if (contact[identifier] != null && typeof contact[identifier] != 'undefined') {
        request['identifier'] = contact[identifier];
      }
    }
    if (identifier != null && typeof identifier != 'undefined') {
      request['identifierType'] = identifier;
    } else {
      request['identifierType'] = 'email';
    }
  }
  request['contactFields'] = contact;
  request['contact'] = contact;

  const visitorContact = getQwCookieValue(qwLocalContactAbstractCookie);
  if (!isVisitor) {
    if (visitorContact != null && contact != null && typeof visitorContact['contactId'] != 'undefined' && visitorContact['contactId'] != null &&
      visitorContact['contactId'] != contact['contactId']) {
      request['visitorContact'] = visitorContact;
    }
  }
  const contactTraits = getQWContactTraitsToLocalStorage();
  if (contactTraits != null) {
    request['traits'] = contactTraits;
  }


  if (sdkSettings != null) {
    let rulesURL = sdkSettings.interceptorURL + "/icept/initialize/" + sdkSettings.appId;
    jQwary.ajax({
      url: rulesURL,
      type: "POST",
      // Satinder Change add header for mobile request
      headers: {
        'platform': sdkSettings.osPlatform
      },
      data: JSON.stringify(request),
      contentType: "application/json",
      crossDomain: true,
      success: function (data) {
        if (data['errorMessage'] != "Key configuration not found") {
          try {
            if (data['traits'] != null && typeof data['traits'] != 'undefined') {
              saveQWContactTraitsToLocalStorage(data['traits']);
            }

          } catch (e) {
            console.log(e);
          }
          qwaryClientIntercept.initializeSession(data); //this method also updates contact data
          qwaryClientIntercept.setProjectRules(data['rules']);
          qwaryClientIntercept.setAutoEventRule(data['events']);
          if (data['events'] != null && typeof data['events'] != 'undefined') {
            saveQwEventsToLocalStorage(data['events']);
          }

          qwRuleCheckOnLoad();
          // Satinder Change Sdk ready
          try {
            qwSdkHook.qwMobileSdkReady('READY');
          } catch (e) {
            console.log('qwMobileSdkReady', e);
          }

          //execute track events after rule is initialized.
          if (typeof qwTracking != 'undefined' && qwTracking != null) {
            let queue = qwTracking.queue;
            if (typeof queue != 'undefined' && queue != null) {
              for (i = 0; i < queue.length; i++) {
                let method = queue[i];
                if (method.type != null && method.type == 'track') {
                  //console.log('Method :: ',method);
                  qwTrack(method.props);
                }

              }
            }

          }
          window.qwTracking = Object.assign({}, window.qwTracking, {
            queue: window.qwTracking && window.qwTracking.queue
              ? window.qwTracking.queue
              : [],
            track: function (t) {
              //console.log('Tracking event :::: ',t);
              qwTrack(t);
            },
            init: function (t) {
              qwInit(sdkSettings);
            },
            logout: function (t) {
              qwaryClientIntercept.cleanup();
            }
          });
        }
        //if(isVisitor){
        //qwaryClientIntercept.updateContactObject(data['contact']);
        //}

      },
      error: function (data, status, er) {
        console.error("error: " + data + " status: " + status + " er:" + er);
      }
    });
  }

}
function qwTrack(eventName) {
  if (qwaryClientIntercept == null) {
    qwaryClientIntercept = jQwary(this).initializeQwaryClientIntercept();
  }
  qwLogHistory(null, "EVENT_TRIGGER", eventName);

  qwaryClientIntercept.processEvent(eventName, eventName);
  // Satinder Change track event with qwEvent
  try {
    qwSdkHook.qwEventTracking(`${eventName}`);
  } catch (e) {
    console.log('qwEventTracking', e);
  }
}
