    /*request['identifierType'] = window.qwSettings.identifier;
    request['identifier'] = sdkSettings.email;
    request['contactFields'] = window.qwSettings['contact'];
    request['surveyUniqueId'] = surveyIdentifier;*/

    let identifier = window.qwSettings.identifier;
