function qwLogMetadata(sessionId, surveyUniqueId) {
  let metadata = new Object();
  let responseSummary = new Object();

  if (typeof sessionId != 'undefined' && sessionId != null) {
    responseSummary['uniqueId'] = sessionId;
  }
  if (typeof surveyUniqueId != 'undefined' && surveyUniqueId != null) {
    responseSummary['surveyUniqueId'] = surveyUniqueId;
  }
  let contact = qwaryClientIntercept.getContactObj();
  if (contact != null && typeof contact != 'undefined') {
    responseSummary['contact'] = contact;
  }
  let language = navigator.language || navigator.userLanguage;
  if (language != null && language != '') {
    if (device.type) {
      responseSummary['deviceType'] = device.type;
    }
    responseSummary['languageCode'] = language;
  }
  metadata['summary'] = responseSummary;
  const contactTraits = getQWContactTraitsToLocalStorage();
  if (contactTraits != null) {
    metadata['traits'] = contactTraits;
  }


  let appId = window.qwSettings.appId;
  let rulesURL = window.qwSettings.interceptorURL + "/icept/metadata/" + appId;
  jQwary.ajax({
    url: rulesURL,
    type: "POST",
    data: JSON.stringify(metadata),
    contentType: "application/json",
    crossDomain: true,
    success: function (data) {
      saveQWContactTraitsToLocalStorage(data);
      //console.log('History logged');
    },
    error: function (data, status, er) {
      console.log("error: " + data + " status: " + status + " er:" + er);
    }
  });
}

