  let jscript/* @cc_on=@_jscript_version@ */;
  let styleProp = (jscript) ? "display" : "pointerEvents";

  // let KoreSampl = function() {};
  function fromEvent(e, lastElement) {
    e = e || window.event; // IE for window.event
    return atPoint(e.clientX, e.clientY, lastElement);
  }

  function atPoint(clientX, clientY, lastElement) {
    // support for child iframes
    let d = (lastElement) ? lastElement.ownerDocument : document;
    // the last element in the list
    lastElement = lastElement || d.getElementsByTagName("html")[0];

    let element = d.elementFromPoint(clientX, clientY);
    if (element === lastElement || element.nodeName === "HTML") {
      return [element];
    } else {
      let style = element.style[styleProp];
      element.style[styleProp] = "none"; // let us peak at the next layer
      let result = [element].concat(atPoint(clientX, clientY, lastElement));
      element.style[styleProp] = style; // restore
      return result;
    }
  }


